# coding=utf-8from selenium import webdriverclass Login(object):    def login(self):        return ""    def login_without_qr(self, url, browser, acctountId, passwordId, submit, account, password):        """        :param url: 登陆地址        :param browser: 浏览器        :param acctountId: 账号输入框 id        :param passwordId: 密码输入框 id        :param submit 提交按钮        :param acctount: 账号        :param password: 密码        :return:        """        browser.get(url)        browser.find_element_by_id(acctountId).click()        browser.find_element_by_id(acctountId).send_keys(account)        browser.find_element_by_id(passwordId).click()        browser.find_element_by_id(passwordId).send_keys(password)        submit_array = browser.find_elements_by_class_name(submit)        if len(submit_array) > 0:            submit_array[0].click()if __name__ == "__main__":    url = "http://47.96.183.143/#/login"    browser = webdriver.Chrome()    acctountId = "account"    passwordId = "password"    acctount = "admin"    password = "111111"    submit = "ant-btn-lg"    login = Login()    login.login_without_qr(url, browser, acctountId, passwordId, submit, acctount, password)